import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  Box,
  Card,
  Image,
  Heading,
  Text,
  Flex,
  Link
} from 'rebass';
import preset from '@rebass/preset'

function App() {
  return (

    <Flex
    theme={preset}
      px={2}
      py={2}
      color='white'
      bg='black'
      alignItems='center'>
      <Text p={2} fontWeight='bold'>Portfolio</Text>
      <Box mx='auto' />
      <Link color='white' variant='nav' href='#'>
        Profile
  </Link>
    </Flex>
  );
}

export default App;
